      height: '600px',
      width: '100%',
      borderRadius: 8,
      display: 'flex',
      marginLeft: '10px',
      marginTop: '10px'
    }
  }),
);

const Homepage: React.FC = () => {
    const classes = useStyles()
    return (
        <>
        <CssBaseline/>
        <Container className={classes.root} >
          <img src={epicImage} alt=""/>
            <Link href="/epicSeven">
                <a>Epic Seven Heroes</a>
            </Link>
        </Container>
        </>
    )
}



export default Homepage
